 <p>
  Extracting essential data from a dataset and displaying it is a necessary part of data science; therefore individuals can make correct decisions based on the data. In this assignment, you will extract some essential economic indicators from some data, you will then display these economic indicators in a Dashboard. You have the
  <strong>
   option
  </strong>
  of hosting  the  Dashboard in IBM object Storage.
 </p>
 <p>
  <a href="https://en.wikipedia.org/wiki/Gross_domestic_product" title="">
   Gross domestic product (GDP)
  </a>
  is a measure of the market value of all the final goods and services produced in a period. GDP is an indicator of how well the economy is doing. A drop in GDP indicates the economy is producing less; similarly an increase in GDP suggests the economy is performing better. In this assignment you will examine how changes in GDP impact the unemployment rate. You will take screen shots of every step. You will share the notebook via a URL.
 </p>
</co-content>
